import React from 'react';

class Quotes extends React.Component {
    render() {
        return (
            <div>
                <h1>Request A Quote</h1>
                <h3>See if you can benefit from my services.</h3>
                <form id="CustomerQuote">
                    <label>Fuck</label>
                </form>
            </div>
        );
    }
}

export default Quotes;
